import React from 'react'
import "../css/Header.css"
import { GiHamburgerMenu } from 'react-icons/gi';
function Header() {
  function mobileNavBar() {
    var x = document.getElementById("top_nav");
    if (x.className === "topnav") {
      x.className += " responsive";
    } else {
      x.className = "topnav";
    }
  }
  window.onscroll = function() {
    var navbar2 = document.getElementById("top_nav");
    if (this.scrollY > 20) {
      navbar2.classList.add("scroll");
    } else {
      navbar2.classList.remove("scroll");
    }
  };
  return (
    <div className="header">
      <div className="topnav" id="top_nav">
        {/*<a href="/">*/}
        {/*  <img src="data:image/png;base64," alt="img"/></a>*/}
        {/*<a href="#contactus">Contactus</a>*/}
        <a href="#home"><b>  </b></a>
        {/*<a href="#blog">""</a>*/}
        {/*<a href="#clients">" "</a>*/}
        {/*<a href="#pricing">" "</a>*/}
        <a href="#getInTouch">""</a>
        <a href="#pricing">""</a>
        <a href="#feature">"O"</a>
        <a href="#service">""</a>
        <a href="#about">" "</a>
        <a href="#home" className="active">""</a>
        <a href="#" className="icon" >
          <GiHamburgerMenu onClick={mobileNavBar}/>
        </a>
      </div>
    </div>
  )
}

export default Header
